def countWinners(n, pick):
    # Initialize a dictionary to keep track of the count of balls each player has picked for each color
    player_picks = {i: {} for i in range(n)}

    # Iterate through the picks and update the count
    for player, color in pick:
        if color not in player_picks[player]:
            player_picks[player][color] = 0
        player_picks[player][color] += 1

    # Initialize a counter for the number of winners
    winners = 0

    # Check the winning conditions for each player
    for player in range(n):
        max_required = player + 1
        if any(count >= max_required for count in player_picks[player].values()):
            winners += 1

    return winners

